import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
}
<body>
  <app-nav-menu></app-nav-menu>
  <div class="container">
    <nav>
      <ul>
        <li><a routerLink="/">Hero List</a></li>
        <li><a routerLink="/add-hero">Add Hero</a></li>
      </ul>
    </nav>
    <router-outlet></router-outlet>
  </div>
</body>
